def salvarCadastro():       # Função que valida os campos de cadastro e faz o registro no banco de dados
    nome = values['nome']
    email = values['emailCad']     # Atribuindo o valor dos campos de cadastro a variaveis
    senha = values['senha']
    senhaCad = values['senhaCad']
    if (nome == '' or nome == ' ') or (email == '' or email == ' ') or (senha == '' or senha == ' '):       # Verifica se os campos foram preenchidos
        sg.popup('Todos os campos devem ser preenchidos.', title='ERRO!', icon=ICONE_FILE, button_color=['White', 'Red'])

    elif senha != senhaCad:
        sg.popup('As senhas não correspondem', title='ERRO!', icon=ICONE_FILE, button_color=['White', 'Red'])       # Verifica se as senhas digitadas no cadastro estão iguais

    else:
        BdMiniSistema.cursor.execute('SELECT * FROM usuarios WHERE Email = %s', [email])        # Verifica se um email ja está cadastrado no banco de dados
        if BdMiniSistema.cursor.rowcount:
            sg.popup('Este Email já está cadastrado.', title='ERRO!', icon=ICONE_FILE, button_color=['White', 'Red'])
        else:
            senha = senha.encode('utf-8')
            senha_hash = plib.hash(senha)       # Criptografa a senha pra ser salva no banco de dados
            BdMiniSistema.cursor.execute('INSERT INTO `usuarios` (`Nome`, `Email`, `Senha`) VALUES (%s, %s, %s)', (nome, email, senha_hash))    # Insere o cadastro com a senha criptografada no banco de dados
            BdMiniSistema.conexao.commit()
            sg.popup('{} cadastrado(a) com sucesso! '.format(nome), title='Cadastro Realizado!', icon=ICONE_FILE)
            janelaCadastro.close()


def login():        # Função que valida o login
    email = values['email']
    senha = values['senha_login']
    BdMiniSistema.cursor.execute('SELECT * FROM usuarios WHERE Email = %s', [email])        # Confere se o usuário informou um email válido
    if BdMiniSistema.cursor.rowcount == 0:
        sg.popup('Este Email não foi previamente cadastrado.\nConsidere fazer o seu cadastro.\n', title='ERRO!', icon=ICONE_FILE, button_color=['White', 'Red'])
    else:
        senha = senha.encode('utf-8')
        BdMiniSistema.cursor.execute('SELECT * FROM usuarios WHERE Email = %s', [email])        # Email confirmado, busca a senha no banco de dados
        senhaNoBanco = BdMiniSistema.cursor.fetchone()[2] # [2] Pois é a posição da coluna senha na tabela usuários no banco de dados

        if plib.verify(senha, senhaNoBanco):        # Verifica se a senha informada confere com a senha criptografada e salva no banco de dados
            janelaLogin.close()                     # Fecha a janela de login
            logado()                                # Abre a tela do usuario


        else:
            sg.popup_quick_message('Acesso negado, tente novamente ou faça um cadastro.', background_color='Red', text_color='White', auto_close_duration=3)


